import React, {Component} from 'react';
import './App.css';
import About_me from './components/About_me.js'
import "tachyons";

class App extends Component{
  render(){
    return (
      <div className="App">

      	<div className="fl w-20 vh-100 bg-near-black tc">
      	</div>

      	<div className="fl w-80 vh-100 bg-moon-gray tc">
          <About_me/>
      	</div>

      </div>
    );
  }
}

export default App;
